import s from './MainSection.module.scss';
import homeMainIcon from '../../../assets/home-main.svg';
import Typewriter from '../../../components/UIElements/Typewriter/Typewriter';
import { LazyLoadImage } from 'react-lazy-load-image-component';

const MainSection = () => {
  return (
    <section className={s.content}>
      <div className={s.header}>
        <h2 style={{ paddingBottom: 15 }} className={s.title}>
          Hi There! <span className={s.wave}>üëãüèª</span>
        </h2>
        <span style={{ display: 'flex', alignItems: 'stretch' }}>
          <svg style={{ flex: "0 0 150px" }}>
            <text x="50" y="100" style={{fontFamily: 'myFirstFont' ,src: 'url(../../../../public/fonts/Volkszeitung 21.tff)'}}>I'M</text></svg>
          <span style={{ flexDirection: "column", display: 'flex', flexGrow: 1 }}>
            <h1 className={s.mainTitle}>

              <strong className={s.mainName}> Vatsal Kevadiya</strong>
            </h1>

            <div style={{ paddingTop: 50 }}>
              <Typewriter
                strings={[
                  'MERN Stack Developer',
                  'Continuously Learning',
                ]}
                wrapperClassName={s.typewriterWrapper}
                cursorClassName={s.typewriterCursor}
              />
            </div>
          </span>
        </span>
      </div>

      <LazyLoadImage
        alt="home-img"
        effect="blur"
        src={homeMainIcon}
        wrapperClassName={s.homeMainIcon}
      />
    </section>
  );
};

export default MainSection;
